import React from "react";
import { Link} from "react-router-dom";
import "./dashboard.css";
import report from './ProgressReport/report';
const Dashboard = () => {

    
  
  return (
    <div className="main">
        <div className="title">
    <h1>Dashboard</h1>
  </div>

<div className="other">
      <ul>
        <li>
          <Link to="/dashboard/chat">Chat System</Link>
        </li>
        <li>
          <Link to="/dashboard/achievements">Track Achievements</Link>
        </li>
        <li>
          <Link to="/dashboard/progress">View Progress Report</Link>
        </li>
      </ul>
      </div>
      
      
        
        
      </div>
  

  );
};
function ProgressReport({ progressData }) {
  return (
    <div className="progress-report">
      <h2>Progress Report</h2>
      <p>Mid Term Score: {progressData.midTerm}</p>
      <p>Final Term Score: {progressData.finalTerm}</p>
    </div>
  );
}

export default Dashboard;
